import React, { useState, useEffect } from 'react';
import { Avatar, Button, message } from 'antd';
import { UserOutlined, UploadOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const AdministracionDeCuenta = () => {
  const navigate = useNavigate();
  const [userData, setUserData] = useState({});
  const [profileImage, setProfileImage] = useState(null);

  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');

    // Fetch user data from backend
    axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`)
      .then(response => {
        setUserData(response.data);
        setProfileImage(response.data.Foto_Perfil); // Asegúrate de obtener la URL correcta de la imagen de perfil
      })
      .catch(error => {
        message.error('Failed to load user data');
      });
  }, []);

  // Función para el botón de cierre de sesión
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  return (
    <div style={{ maxWidth: 600, margin: '0 auto', padding: '20px' }}>
      <h1>My Profile</h1>
      <Avatar size={100} src={profileImage} icon={<UserOutlined />} style={{ marginBottom: 16 }} />
      <p><strong>Name:</strong> {userData.nombre}</p>
      <p><strong>Email:</strong> {userData.email}</p>
      <Button type="primary" onClick={handleLogout} style={{ marginRight: 16 }}>
        Cerrar Sesión
      </Button>
    </div>
  );
};

export default AdministracionDeCuenta;
